import { useSelector } from "react-redux"

const selectDays = state => state.categories.days

function Statistics(props) {

    const days = useSelector(selectDays)
    const renderedDays = Object.values(days)
    console.log(renderedDays)

    const rendered = Object.keys(days).map(day => (
        <div>
            <h1>{day}</h1>
            <div>
                {Object.keys(days[day]).map((category) => (
                    <div>{days[day][category]}</div>
                ))}
            </div>
        </div>


    ))

    return (
        <div className=" mt-52">
            {renderedDays}
        </div>
    )

}

export default Statistics
